  const { user, setUser } = useContext(UserContext);

  useEffect(() => {
    const user = AuthService.getCurrentUser();
    if (user) {
      setUser(user.username);
    } else {
    }
  });

  return <div>{user ? <Redirect to="/" /> : null}</div>;
}
